import React from 'react';
import {fetchTransactionDetailsApi} from "./Utils";
import {Table} from "reactstrap";
import CreditDetails from "./CreditDetails";
import DebitDetails from "./DebitDetails";
import 'antd/dist/antd.css';
import {
    Form,
    Input,
    Button,
    Radio,
    Select,
    Cascader,
    DatePicker,
    InputNumber,
    TreeSelect,
    Switch,
} from 'antd';

class TransactionDetails extends React.Component{

    constructor() {
        super();
        this.state={
            accountNumber:window.localStorage.getItem('accountNumber'),
            records:[],
            option:'all',
            startDate:new Date()

        }
        this.handleChange=this.handleChange.bind(this)
        this.handleSubmit=this.handleSubmit.bind(this)
    }
    handleChange(e){
        if(e.target.value==='Date'){
            <DatePicker selected={this.state.startDate}  onChange={(e) => this.handleChange({startDate: e})} />
            return;
        }
        this.setState({option:e.target.value})
    }

    handleSubmit(event){

        event.preventDefault();
    }
    componentDidMount() {

            fetchTransactionDetailsApi(this.state.accountNumber).then((data) =>{
                console.log(data)
                this.setState({records:data.data})
            }).catch((error) =>{
                console.log(error)
            })

    }



    render()
    {


        var recordsList=this.state.records.map(function (i){
            return(
                <tr>
                    <td>{i.time}</td>
                    <td>{i.transDetails}</td>
                    <td>{i.debit==='debit'?`₹ ${i.amount}`:"-"}</td>
                    <td>{i.credit==='credit'?`₹ ${i.amount}`:"-"}</td>

                    <td>{`₹ ${i.totalBalance}`}</td>
                </tr>
            )
        })

        var show = <Table bordered>
            <thead>
            <tr>
                <th>Date</th>
                <th >Details </th>
                <th> Debit </th>
                <th> Credit </th>
                <th> Total balance</th>
            </tr>
            </thead>

            <tbody>
            {recordsList}
            </tbody>
        </Table>;
        if(this.state.option==='Show by Credit')
            show=<CreditDetails/>
        if(this.state.option==='Show by Debit')
            show=<DebitDetails/>
        return(
            <div>
                {show}
                <Form
                    labelCol={{
                        span: 4,
                    }}
                    wrapperCol={{
                        span: 14,
                    }}
                    layout="horizontal"

                >


                    <Form.Item label="Select">
                        <Select>
                            <Select.Option value="demo">Show details by Date</Select.Option>
                            <Select.Option value="demo">Demo</Select.Option>
                            <Select.Option value="demo">Demo</Select.Option>
                            <Select.Option value="demo">Demo</Select.Option>
                        </Select>
                    </Form.Item>
                    <Form.Item label="TreeSelect">
                        <TreeSelect
                            treeData={[
                                {
                                    title: 'Light',
                                    value: 'light',
                                    children: [
                                        {
                                            title: 'Bamboo',
                                            value: 'bamboo',
                                        },
                                    ],
                                },
                            ]}
                        />
                    </Form.Item>
                    <Form.Item label="Cascader">
                        <Cascader
                            options={[
                                {
                                    value: 'zhejiang',
                                    label: 'Zhejiang',
                                    children: [
                                        {
                                            value: 'hangzhou',
                                            label: 'Hangzhou',
                                        },
                                    ],
                                },
                            ]}
                        />
                    </Form.Item>
                    <Form.Item label="DatePicker">
                        <DatePicker />
                    </Form.Item>
                    <Form.Item label="InputNumber">
                        <InputNumber />
                    </Form.Item>
                    <Form.Item label="Switch">
                        <Switch />
                    </Form.Item>
                    <Form.Item label="Button">
                        <Button>Button</Button>
                    </Form.Item>
                </Form>




            </div>


        );
    }

}

export default TransactionDetails;
